import React, {useEffect, useState} from 'react';
import Pages from "./Pagination/Pages";
import "./CarsPageStyle.css"
import CarCard from "./CarsCard/CarsCard";
import axios from "axios";
import {Card} from "react-bootstrap";
import CarsCard from "./CarsCard/CarsCard";

function CarsPage(props) {
    const [cars, setCars] = useState(undefined);
    const [totalCount, setTotalCount] = useState(undefined)
    let carsCards = []

    useEffect(() => {
        console.log(cars)
        cars.forEach(car => {carsCards.push(<CarsCard price={car.price} name={car.name}/>)})
    }, [cars])

    return (
    <div className={"main-container"}>
        <div className={"cars-content"}>
            <button className={"test-btn"} onClick={() => {
                axios.get("http://0a3c46248aa4.ngrok.io/cars/get-car-page", {
                    params: {
                        'page': 1,
                        'per-page': 5
                    }
                }).then(it => {
                        setTotalCount(it.data.totalCount)
                        setCars(it.data.items)
                    }
                )
                }}/>
            <div className="container cars-container">
                <div className="row">
                    {carsCards}
                </div>
            </div>
            <Pages />
        </div>

    </div>
    );
}

export default CarsPage;
